package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;import java.util.Date;/** * 	日志短信 */@TableName("log_sms")public class LogSms implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	private String target;	private String code;	private Integer isuse;	private String type;	private String result;	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date createTime;	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date expriedTime;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getTarget() {		return target;	}	public void setTarget(String target) {		this.target = target;	}	public String getCode() {		return code;	}	public void setCode(String code) {		this.code = code;	}	public Integer getIsuse() {		return isuse;	}	public void setIsuse(Integer isuse) {		this.isuse = isuse;	}	public String getType() {		return type;	}	public void setType(String type) {		this.type = type;	}	public String getResult() {		return result;	}	public void setResult(String result) {		this.result = result;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getExpriedTime() {		return expriedTime;	}	public void setExpriedTime(Date expriedTime) {		this.expriedTime = expriedTime;	}}